          "id": "a7c76d93732742e3392507be0a8b6f4dc8a9687a",
          "message": "Add type parameter to KeySpace and GenEnv (#4908)\n\n* Add type parameter to KeySpace and GenEnv.\n\nChange:\n- `KeySpace era` to `KeySpace c era`, and\n- `GenEnv era` to `GenEnv c era`.\n- Make the rest of the project compile, judiciously using `MockCrypto`\nto specialize where necessary.\n\nWhy:\nThe `test-suite` package from `cardano-ledger-shelley` exports some\nfunctions and data-types that are used by `ouroboros-consensus-cardano`\npackage to write tests. These functions and data-types were\nmonomorphic to `MockCrypto` from `cardano-ledger` while the ones\nfrom `ouroboros-consensus-cardano` need those to be monomorphic to\n`MockCrypto` from `ouroboros-consensus-cardano`. This in another one of\nthe many changes necessary to propogate the removal of the `EraCrypto`\ntype-class from `cardano-ledger` into `ouroboros-consensus` and further\ndownstream.\n\n* Update CHANGELOG\n\n* Update cabal dependencies\n\n* Apply suggestions from code review\n\nCo-authored-by: Alexey Kuleshevich <alexey.kuleshevich@iohk.io>\n\n---------\n\nCo-authored-by: Alexey Kuleshevich <alexey.kuleshevich@iohk.io>",
